import React from 'react';
import Noticia from './noticia';
import Card from './component/card';
import 'bootstrap/dist/css/bootstrap.min.css';

import './App.css';

function App() {
  return (
    <div className="App">
    <div className="noticia">
      <Noticia/>
    </div>
    <div className="Card">
      <Card />

    </div>
    </div>
  );
}

export default App;
